Saudi Arabia has extremely strict laws and social norms governing all content related to sex. According to local laws, **all pornography (including videos, pictures, magazines, literature, etc.) is completely illegal in Saudi Arabia**, regardless of the form or details of the content. Therefore, there is no such thing as "what sexual content is allowed", and **any content containing sexual depictions, acts, nudity, or erotic references is strictly prohibited**. Anyone found possessing, distributing or attempting to import such content, regardless of the specific sexual subject matter, will face severe legal penalties.

Specifically, prohibitions under Saudi law include (but are not limited to)
- Any form of explicit or implicit images, photographs, writings or drawings of sexual acts;
- Any image of a naked or semi-naked human body (male or female);
- Sneak peeks, sexual harassment, and sexually suggestive content;
- "Adult products" and related publicity.

In addition, Internet content is also extremely strictly regulated in Saudi Arabia, with many international pornography and related websites completely blocked, and technical means of circumventing regulation are also illegal.

**Summary**: All pornography involving sexual content is prohibited in Saudi Arabia, without exception. All content related to it is expressly prohibited, regardless of its form, type or specific expression.

Feel free to continue asking questions if you have further questions about Saudi law and culture.

